import React from 'react';
import {connect} from 'react-redux';
import './Categories.css';

const Categories = () => {
  return (
    <div className='Categories_wrapper'>
    <div className="categories_form_wrapper">
      <form className='categoties_form'>
        <input type="text" placeholder='input categories' className='categories_name'/>
        <input type="submit" value="Зберегти" className='btn_save'/>
      </form>
      </div>
      <div className="gategories_list">
      <p>Категорії</p>
      <ul>
        <li>products</li>
        <li>service</li>
        <li>dress</li>
        <li>tel</li>
        <li>transport</li>
        <li>party</li>
      </ul>
      </div>
    </div>
  );
};

function mapStateToProps (state) {
  return {
    flag: state.showModal,
    change: state.change,

  }
}


function mapDispatchToProps (dispatch) {
return {
  summ: function(e) {
    dispatch(summ(e))
  },
  date: function(e) {
    dispatch(date(e))
  },
  desc: function(e) {
    dispatch(description(e))
  },
  categories: function(e) {
    dispatch(categories(e))
  },
  show: function() {
    dispatch(cancel())
  },
}
}


export default connect() (Categories);
